description:
Door meenemers te plaatsen op de glazen schuifwanden, kunnen de glaspanelen gemakkelijk en evenredig naar een zijde geduwd of getrokken worden. De meenemers worden per stuk geleverd. Het benodigde aantal meenemers is afhankelijk van het aantal glaspanelen. Let op! Deze meenemer kan alleen besteld worden in combinatie met een schuifwand uit onze webshop.

De verstelbare meenemers bestaan uit:
-	Afdekplaatje voor het glasprofiel;
-	Blokje voor het glasprofiel;
-	Schroefjes.
